import React from "react";
import './style.css';
import lisa from "./lisa.jpg";
import angry from "./angry.jpg";

function Grid() {
  return (
    <div class="grid-container">
      <div class="grid-item">
        <img src={lisa} alt="angrey lisa" />
          <div class="overlay">
            <div class="text">UI Design: UNIQLO App Prototype</div>
          </div>
      </div>
      <div class="grid-item">
        <img src={angry} alt="angrey lisa2" />
      </div>
    </div>
  )
}

export default Grid;
